import { Icon, Menu } from "antd";
import Link from "next/link";
const links = () => (
	<>
		<Link href="/">
			<div className="navlink">
				<Icon type="home" />
			</div>
		</Link>
		<Link href="/about-me">
			<Icon type="user" />
		</Link>
	</>
);

export default links;
